import React, { useEffect, useState } from "react";
import EventItemOrg from "./EventItemOrg";
import StudentSidebar from "./StudentSidebar";

function StudentMyEvent() {
  const host = "http://localhost:5000";
  let event = [{date: "",
    event: "",
    org: "",
    student :"",
    __v: 0,
    _id: ""}];
    
  let [events, setEvents] = useState(event);

  useEffect(() => {
    // API call
    const Profile = async () => {
      const response = await fetch(`${host}/api/Studentevent/getRegisteredEventsId`, {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
          "auth-token": localStorage.getItem("Studenttoken"),
        },
      });
      const result = await response.json();
      setEvents(result)
      console.log(result);
      console.log(events);
    };
    Profile();

    const getEvents = async () =>{
        const response = await fetch(`${host}/api/Studentevent/getEvent`, {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
              "auth-token": localStorage.getItem("Studenttoken"),
            },
      body: JSON.stringify({eventId:events.event}),
          });
          const result = await response.json();
          setEvents(result)
          console.log(result);
          console.log(events);
    };
    getEvents();
  }, []);

  return (
    <>
      <StudentSidebar />
      <div
        style={{
          paddingLeft: "22%",
          height: "100%",
          paddingTop: "100px",
        }}
      >
        {events.length === 0 && (
          <div
            className="container text-center mt-3"
            style={{
              width: "100%",
              height: "300px",
              backgroundColor: "#BFEAF5",
              justifyContent: "center",
              marginRight: "5%",
            }}
          >
            <h1>"No Events for Display"</h1>
          </div>
        )}
        {events.map((event, index) => {
          return <EventItemOrg key={index} event={event} />;
        })}
      </div>
    </>
  );
}

export default StudentMyEvent;
